import base64
import datetime

x='2023-05-30'    #畢業日期 格式：YYYY-MM-DD

a=''
b=''
if str(datetime.date.today())==x:
    while 1:
        try:
            a=base64.b64decode(a).decode('UTF-8')
        except:break
    with open('Graduate.txt','w',encoding='utf-8') as k:
        k.write(str(a))
else:
    while 1:
        try:
            b=base64.b64decode(b).decode('UTF-8')
        except:break
    with open('Graduate.txt','w',encoding='utf-8') as k:
        k.write(str(b))
print('解密完成~')